import React, { useState, useEffect } from 'react';

const KeyRegistration = ({ onRegister, isLoading, currentUser }) => {
  const [publicKey, setPublicKey] = useState('');
  const [error, setError] = useState('');
  const [isSubmitting, setIsSubmitting] = useState(false);

  // Automatically set the wallet address as public key
  useEffect(() => {
    if (currentUser) {
      setPublicKey(currentUser);
    }
  }, [currentUser]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    
    if (!publicKey.trim()) {
      setError('Public key is required');
      return;
    }

    if (publicKey.length < 10) {
      setError('Public key must be at least 10 characters long');
      return;
    }

    setIsSubmitting(true);
    
    try {
      await onRegister(publicKey.trim());
    } catch (error) {
      setError(error.message || 'Failed to register public key');
    }
    
    setIsSubmitting(false);
  };

  const generateSampleKey = () => {
    // Generate a sample public key for demonstration
    const timestamp = Date.now();
    const randomStr = Math.random().toString(36).substring(2, 15);
    const sampleKey = `pub_key_${timestamp}_${randomStr}`;
    setPublicKey(sampleKey);
  };

  return (
    <div className="key-registration-overlay">
      <div className="key-registration-modal">
        <div className="modal-header">
          <h2>üîê Register Your Public Key</h2>
          <p>To start messaging, you must register a public key. This ensures secure communication on the blockchain.</p>
        </div>
        
        <form onSubmit={handleSubmit} className="registration-form">
          <div className="form-group">
            <label htmlFor="publicKey">Enter Your Public Key:</label>
            <textarea
              id="publicKey"
              value={publicKey}
              onChange={(e) => setPublicKey(e.target.value)}
              placeholder="Enter your public key here..."
              rows={4}
              disabled={isSubmitting}
              className={error ? 'error' : ''}
            />
            <small className="help-text">
              This key will be stored on the blockchain and used to identify you in conversations.
            </small>
          </div>

          {error && (
            <div className="error-message">
              <span>‚ö†Ô∏è {error}</span>
            </div>
          )}

          <div className="form-actions">
            <button
              type="button"
              onClick={generateSampleKey}
              className="btn-secondary"
              disabled={isSubmitting}
            >
              Generate Sample Key
            </button>
            
            <button
              type="submit"
              className="btn-primary"
              disabled={isSubmitting || !publicKey.trim()}
            >
              {isSubmitting ? (
                <span>
                  <span className="spinner"></span>
                  Registering...
                </span>
              ) : (
                'Register Key'
              )}
            </button>
          </div>
        </form>

        <div className="registration-info">
          <h3>üìã What happens next?</h3>
          <ul>
            <li>‚úÖ Your public key will be stored on the Fluent blockchain</li>
            <li>üîí This enables secure messaging with other users</li>
            <li>üí∏ A small gas fee will be required for the transaction</li>
            <li>‚è±Ô∏è The registration process may take a few moments</li>
          </ul>
        </div>

        {isLoading && (
          <div className="loading-overlay">
            <div className="loading-spinner">
              <div className="spinner large"></div>
              <p>Connecting to blockchain...</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default KeyRegistration;
